import React from 'react';

function VotePanel({ onVote }) {
  return (
    <div style={{ marginTop: 20, textAlign: 'center' }}>
      <h3>Ce mot est-il valide ?</h3>
      <button
        onClick={() => onVote(true)}
        style={{
          padding: '10px 20px',
          margin: '10px',
          fontSize: '18px',
          backgroundColor: '#4CAF50',
          color: 'white',
          border: 'none',
          borderRadius: '5px'
        }}
      >
        ✅ Valider
      </button>
      <button
        onClick={() => onVote(false)}
        style={{
          padding: '10px 20px',
          margin: '10px',
          fontSize: '18px',
          backgroundColor: '#f44336',
          color: 'white',
          border: 'none',
          borderRadius: '5px'
        }}
      >
        ❌ Refuser
      </button>
    </div>
  );
}

export default VotePanel;
